import React from 'react';
import 'LateralMenu.css';

class LateralMenu extends React.Component{
	getDivStyle = () => {
		return {
			float: 'left',
			background: '#4682B4',
			display: 'block',
			padding: '30px 10px',
			width: '25%',
			height: '100vh',

			// changing fonts...
			color: '#F0F8FF',
			fontFamily: "verdana",
			fontWeight: 'bold',
			fontSize: '12px',

		}
	}


	render(){
		/*
		const pStyle = {
			backgroundColor: '#483D8B',
		};
		*/

		return(
			<div style={this.getDivStyle()}>
				<p>COMPANIES</p>
				<p>USUÁRIOS</p>
				<p>RESETAR SENHA</p>
				<p>SIMULAÇÃO</p>
			</div>
		);
	}
}

export default LateralMenu;

